function commonDenominators(){let e=[];const r=Array.from(new Set(Object.values(arguments).filter(e=>Number.isInteger(e)&&e>0))).sort((e,r)=>e-r);let t=[];let n=r[0];let l=r[0];while(n>0){l%n===0?t.push(n):null;n--}if(r.length<2||t.length===1){return t.reverse()}const o=r.slice(1).reduce((e,r)=>{let n=t.length-1;while(n>0){r%t[n]===0?e.push(t[n]):null;n--}return e},t).sort((e,r)=>e-r);Array.from(new Set(o)).reduce((t,n)=>{r.forEach(e=>{e%n===0?t++:false});t===r.length?e.push(n):null;return t=0},0);return e}module.exports=commonDenominators;